import React, { useState, useEffect } from 'react';
import { Upload, Image, Settings, Sparkles, Gem, Zap, Check, X, Trash2, Eye, AlertCircle } from 'lucide-react';
import { supabase } from '../lib/supabase';

const AdminPanel = () => {
  const [selectedMetal, setSelectedMetal] = useState('');
  const [selectedDesign, setSelectedDesign] = useState('');
  const [selectedShape, setSelectedShape] = useState('');
  const [selectedCarat, setSelectedCarat] = useState('');
  const [selectedFile, setSelectedFile] = useState(null);
  const [previewUrl, setPreviewUrl] = useState('');
  const [uploading, setUploading] = useState(false);
  const [uploadedImages, setUploadedImages] = useState([]);
  const [message, setMessage] = useState('');

  // Updated options based on your specifications
  const metals = [
    { value: 'white-gold', label: 'White Gold (14K/18K)' },
    { value: 'yellow-gold', label: 'Yellow Gold (14K/18K)' },
    { value: 'rose-gold', label: 'Rose Gold (14K/18K)' },
    { value: 'platinum', label: 'Platinum (950)' }
  ];

  const designs = [
    { value: 'classic-solitaire', label: 'Classic Solitaire' },
    { value: 'halo-setting', label: 'Halo Setting' },
    { value: 'vintage-antique', label: 'Vintage/Antique Style' },
    { value: 'three-stone', label: 'Three Stone (Trinity)' }
  ];

  const shapes = [
    { value: 'round', label: 'Round Brilliant Cut' },
    { value: 'princess', label: 'Princess Cut (Square)' },
    { value: 'emerald', label: 'Emerald Cut (Rectangular)' },
    { value: 'oval', label: 'Oval Brilliant Cut' }
  ];

  const carats = [
    { value: '1.0', label: '1.0 Carat' },
    { value: '1.5', label: '1.5 Carat' },
    { value: '2.0', label: '2.0 Carat' },
    { value: '2.5', label: '2.5 Carat' }
  ];

  useEffect(() => {
    fetchUploadedImages();
  }, []);

  const fetchUploadedImages = async () => {
    try {
      const { data, error } = await supabase
        .from('ring_images')
        .select('*')
        .order('created_at', { ascending: false });

      if (error) throw error;
      setUploadedImages(data || []);
    } catch (error) {
      console.error('Error fetching images:', error);
      setMessage('Error fetching uploaded images');
    }
  };

  const handleFileSelect = (event) => {
    const file = event.target.files[0];
    if (file) {
      setSelectedFile(file);
      const url = URL.createObjectURL(file);
      setPreviewUrl(url);
    }
  };

  const generateImagePath = () => {
    if (!selectedMetal) return '';
    
    let path = `rings/${selectedMetal}`;
    
    if (selectedDesign) {
      path += `/${selectedDesign}`;
    }
    
    if (selectedShape) {
      path += `/${selectedShape}`;
    }
    
    if (selectedCarat) {
      path += `/${selectedCarat}ct.png`;
    } else {
      path += '/band.png';
    }
    
    return path;
  };

  const checkDuplicate = async () => {
    const imagePath = generateImagePath();
    if (!imagePath) return false;

    try {
      const { data, error } = await supabase
        .from('ring_images')
        .select('*')
        .eq('image_url', imagePath)
        .single();

      if (error && error.code !== 'PGRST116') {
        throw error;
      }

      return !!data;
    } catch (error) {
      console.error('Error checking duplicate:', error);
      return false;
    }
  };

  const uploadImage = async () => {
    if (!selectedFile || !selectedMetal) {
      setMessage('Please select a file and metal type');
      return;
    }

    const imagePath = generateImagePath();
    if (!imagePath) {
      setMessage('Please select all required options');
      return;
    }

    // Check for duplicate
    const isDuplicate = await checkDuplicate();
    if (isDuplicate) {
      setMessage('An image for this combination already exists');
      return;
    }

    setUploading(true);
    setMessage('');

    try {
      // Upload file to Supabase Storage
      const { data: uploadData, error: uploadError } = await supabase.storage
        .from('ring-images')
        .upload(imagePath, selectedFile, {
          cacheControl: '3600',
          upsert: false
        });

      if (uploadError) throw uploadError;

      // Get public URL
      const { data: urlData } = supabase.storage
        .from('ring-images')
        .getPublicUrl(imagePath);

      // Save metadata to database
      const { error: dbError } = await supabase
        .from('ring_images')
        .insert({
          metal: selectedMetal,
          design: selectedDesign || null,
          diamond_shape: selectedShape || null,
          carat: selectedCarat ? parseFloat(selectedCarat) : null,
          image_url: imagePath,
          public_url: urlData.publicUrl
        });

      if (dbError) throw dbError;

      setMessage('Image uploaded successfully!');
      setSelectedFile(null);
      setPreviewUrl('');
      setSelectedMetal('');
      setSelectedDesign('');
      setSelectedShape('');
      setSelectedCarat('');
      
      // Reset file input
      const fileInput = document.getElementById('file-input');
      if (fileInput) fileInput.value = '';

      // Refresh the list
      fetchUploadedImages();

    } catch (error) {
      console.error('Upload error:', error);
      setMessage('Error uploading image: ' + error.message);
    } finally {
      setUploading(false);
    }
  };

  const deleteImage = async (id, imageUrl) => {
    try {
      // Delete from storage
      const { error: storageError } = await supabase.storage
        .from('ring-images')
        .remove([imageUrl]);

      if (storageError) throw storageError;

      // Delete from database
      const { error: dbError } = await supabase
        .from('ring_images')
        .delete()
        .eq('id', id);

      if (dbError) throw dbError;

      setMessage('Image deleted successfully!');
      fetchUploadedImages();

    } catch (error) {
      console.error('Delete error:', error);
      setMessage('Error deleting image: ' + error.message);
    }
  };

  return (
    <div className="min-h-screen bg-gray-50">
      {/* Header */}
      <header className="bg-white shadow-soft border-b border-gray-100">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="flex justify-between items-center py-6">
            <div>
              <h1 className="text-3xl font-serif font-semibold text-gray-900">
                Ring Customizer Admin
              </h1>
              <p className="text-gray-600 mt-1">
                Upload structured ring images to Supabase
              </p>
            </div>
            <a href="/" className="btn-secondary flex items-center">
              ‚Üê Back to Customizer
            </a>
          </div>
        </div>
      </header>

      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
        <div className="grid grid-cols-1 lg:grid-cols-2 gap-8">
          {/* Upload Form */}
          <div className="card p-6">
            <h2 className="text-xl font-semibold text-gray-900 mb-6">Upload Ring Image</h2>
            
            <div className="space-y-4">
              {/* Form Fields */}
              <div className="grid grid-cols-2 gap-4">
                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-2">
                    Metal *
                  </label>
                  <select
                    value={selectedMetal}
                    onChange={(e) => setSelectedMetal(e.target.value)}
                    className="w-full p-3 border border-gray-300 rounded-lg focus:ring-2 focus:ring-primary-500 focus:border-primary-500"
                  >
                    <option value="">Select Metal</option>
                    {metals.map(metal => (
                      <option key={metal.value} value={metal.value}>
                        {metal.label}
                      </option>
                    ))}
                  </select>
                </div>

                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-2">
                    Design
                  </label>
                  <select
                    value={selectedDesign}
                    onChange={(e) => setSelectedDesign(e.target.value)}
                    className="w-full p-3 border border-gray-300 rounded-lg focus:ring-2 focus:ring-primary-500 focus:border-primary-500"
                  >
                    <option value="">Select Design (Optional)</option>
                    {designs.map(design => (
                      <option key={design.value} value={design.value}>
                        {design.label}
                      </option>
                    ))}
                  </select>
                </div>

                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-2">
                    Diamond Shape
                  </label>
                  <select
                    value={selectedShape}
                    onChange={(e) => setSelectedShape(e.target.value)}
                    className="w-full p-3 border border-gray-300 rounded-lg focus:ring-2 focus:ring-primary-500 focus:border-primary-500"
                  >
                    <option value="">Select Shape (Optional)</option>
                    {shapes.map(shape => (
                      <option key={shape.value} value={shape.value}>
                        {shape.label}
                      </option>
                    ))}
                  </select>
                </div>

                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-2">
                    Carat Weight
                  </label>
                  <select
                    value={selectedCarat}
                    onChange={(e) => setSelectedCarat(e.target.value)}
                    className="w-full p-3 border border-gray-300 rounded-lg focus:ring-2 focus:ring-primary-500 focus:border-primary-500"
                  >
                    <option value="">Select Carat (Optional)</option>
                    {carats.map(carat => (
                      <option key={carat.value} value={carat.value}>
                        {carat.label}
                      </option>
                    ))}
                  </select>
                </div>
              </div>

              {/* File Upload */}
              <div>
                <label className="block text-sm font-medium text-gray-700 mb-2">
                  Ring Image *
                </label>
                <div className="border-2 border-dashed border-gray-300 rounded-lg p-6 text-center hover:border-primary-400 transition-colors">
                  <input
                    type="file"
                    accept="image/*"
                    onChange={handleFileSelect}
                    disabled={uploading}
                    className="hidden"
                    id="file-input"
                  />
                  <label
                    htmlFor="file-input"
                    className={`cursor-pointer flex flex-col items-center ${
                      uploading ? 'opacity-50 cursor-not-allowed' : ''
                    }`}
                  >
                    <Upload size={32} className="text-gray-400 mb-2" />
                    <p className="text-sm text-gray-600">
                      Click to select image (PNG recommended)
                    </p>
                    <p className="text-xs text-gray-500 mt-1">
                      Max 5MB, 800x800px recommended
                    </p>
                  </label>
                </div>
              </div>

              {/* Preview */}
              {previewUrl && (
                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-2">
                    Preview
                  </label>
                  <div className="relative w-32 h-32 border border-gray-200 rounded-lg overflow-hidden">
                    <img
                      src={previewUrl}
                      alt="Preview"
                      className="w-full h-full object-cover"
                    />
                  </div>
                </div>
              )}

              {/* Upload Button */}
              <button
                onClick={uploadImage}
                disabled={uploading || !selectedFile || !selectedMetal}
                className="w-full btn-primary disabled:opacity-50 disabled:cursor-not-allowed flex items-center justify-center"
              >
                {uploading ? (
                  <>
                    <div className="animate-spin rounded-full h-4 w-4 border-b-2 border-white mr-2"></div>
                    Uploading...
                  </>
                ) : (
                  <>
                    <Upload size={20} className="mr-2" />
                    Upload Image
                  </>
                )}
              </button>

              {/* Status Message */}
              {message && (
                <div className={`p-3 rounded-lg text-sm flex items-center ${
                  message.includes('Error') ? 'bg-red-50 text-red-800 border border-red-200' : 'bg-green-50 text-green-800 border border-green-200'
                }`}>
                  {message.includes('Error') ? (
                    <AlertCircle size={16} className="mr-2" />
                  ) : (
                    <Check size={16} className="mr-2" />
                  )}
                  {message}
                </div>
              )}
            </div>
          </div>

          {/* Uploaded Images */}
          <div className="card p-6">
            <h2 className="text-xl font-semibold text-gray-900 mb-6">Uploaded Images</h2>
            
            <div className="overflow-x-auto">
              <table className="min-w-full divide-y divide-gray-200">
                <thead className="bg-gray-50">
                  <tr>
                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                      Image
                    </th>
                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                      Metal
                    </th>
                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                      Design
                    </th>
                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                      Shape
                    </th>
                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                      Carat
                    </th>
                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                      Path
                    </th>
                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                      Actions
                    </th>
                  </tr>
                </thead>
                <tbody className="bg-white divide-y divide-gray-200">
                  {uploadedImages.map((image) => (
                    <tr key={image.id}>
                      <td className="px-6 py-4 whitespace-nowrap">
                        <img
                          src={image.public_url}
                          alt="Ring"
                          className="h-16 w-16 object-cover rounded-md"
                        />
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">
                        {image.metal}
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">
                        {image.design || '-'}
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">
                        {image.diamond_shape || '-'}
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">
                        {image.carat ? `${image.carat}ct` : '-'}
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">
                        {image.image_url}
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap text-sm font-medium">
                        <button
                          onClick={() => deleteImage(image.id, image.image_url)}
                          className="text-red-600 hover:text-red-900"
                        >
                          Delete
                        </button>
                      </td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AdminPanel;
